import React from 'react';
import Particles from 'react-particles-js';
function App() {
  return (
    <>
     <div className="App" style={{ position: 'relative', overflow: "hidden" }}>
    <Particles
        style={{ position:"absolute",backgroundColor:"red" }}
        height="100vh"
        width="100vw"
        params={{
          particles: {
            color: {
              value: "#000000"
            },
            number: {
              value: 114,
              density: {
                enable: true,
                value_area: 800
              }
            },
            line_linked: {
              color: {
                value: "#000000"
              }
            },
            size: {
              value: 3
            }
          }
        }}
      />
      <header>
        <h2>Hi</h2>
      </header>
    </div>

    </>
  );
}

export default App;
